import React from 'react';
import ListItem from '../components/ListItem';
import Screen from '../components/Screen';

const AccountScreen= () => {
    return (
        <Screen>
            <ListItem 
            title="Mosh Hamadani"
            subTitle="programmingwithmosh@gmail.com"
            image={require('../assets/mosh.jpg')}/>
        </Screen>
    );
}

export default AccountScreen;
